//公用函数
/*static*/ uint8 deg(uint32 v){
	int j;
	for(j = 0; j<8; j++){
		if(f[j+1]>v)
			break;
	}
	return d[j+1];
}

/*static*/ void trip(int K, int X, triple trp){
	int A,B,Y;
	int v;
	A = (53591+J[K]*997)%Q;
	B = 10267*(J[K]+1)%Q;
	Y = (B+X*A)%Q;
	v = myrand(Y,0,1<<20);
	trp->d = deg(v);
	trp->a = 1+myrand(Y,1,L1[K]-1);
	trp->b = myrand(Y,2,L1[K]);
}

/*static*/ uint16 gray_m(int j,float k){
	int i,count_1 = 0,count_j = -1;
	uint16 temp,gray;
	for(i = 1; i<=8192; i++){
		count_1 = 0;
		gray= (uint16)(i^(uint16)floor(i/(float)2.0));
		temp = gray;
		//printf("%d\n",temp);
		while (temp!=0){					//计算所求gray数的二进制表示中1的个数
			//printf("%d\n",temp);
			if((temp&1)!= 0)
				count_1++;
			temp = temp>>1;
			//	printf("%d\n",temp);
		}
		//printf("%d\n",count_1);
		if(count_1 == k)
			count_j++;
		if(count_j == j)
			break;
	}
	return gray;
}

/*static*/ uint32 myrand(int x,int i,int m){
	uint32 temp;
	//	printf("m:%d\n",m);
	temp = (V0[(x+i)%256]^V1[((x/256)+i)%256])%m;
	return temp;
}

/*static*/ void my_xor(uint8 * x, uint8 * y, uint32 size){  // 计算X^Y, 结果保存在X中
	uint32 i;
	for(i = 0; i < size; i++){
		x[i] ^= y[i];
	//	printf("%d",(int)y[i]);
	}
	return;
}

